import React from "react";
import { Paper, Grid } from "@material-ui/core";

function Profile() {
  return (
    <Paper>
      <Grid container>
        <Grid item xs={12}>
          <img
            className="make-small-image-clickable-neutral  iconPc"
            style={{
              position: "relative",
              objectFit: "contain",
              width: "100%",
              borderRadius: "200px",
              margin: "auto",
            }}
            src={profilePic}
            alt="Superstarz Billboard Image"
          />
        </Grid>
      </Grid>
    </Paper>
  );
}

export default Profile;
